import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Extract all product data from the page
    const productData = await page.evaluate(() => {
      const products = [];
      const productCards = document.querySelectorAll('.product-card');

      productCards.forEach(card => {
        const title = card.querySelector('.product-title')?.textContent?.trim();
        const price = card.querySelector('.product-price')?.textContent?.trim();
        const rating = card.querySelector('.stars')?.textContent?.trim();
        const reviews = card.querySelector('.rating-count')?.textContent?.trim();

        if (title && price) {
          products.push({
            title,
            price,
            rating: rating || 'No rating',
            reviews: reviews || 'No reviews'
          });
        }
      });

      return products;
    });

    // Extract user profile links
    const profileLinks = await page.$$eval('a[href="#"]', links => 
      links.map(link => link.textContent?.trim()).filter(text => text && text.includes('Your'))
    );

    // Extract category data
    const categories = await page.$$eval('.category-card', cards => 
      cards.map(card => card.textContent?.replace(/\s+/g, ' ').trim())
    );

    // Extract search suggestions
    await page.click('#searchInput');
    await page.waitForTimeout(1000);
    await page.type('#searchInput', 'electronics');
    await page.waitForTimeout(1000);

    // Take screenshot after search input
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_search_input.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_search_input.png'));

    // Extract all link data
    const allLinks = await page.$$eval('a', links => 
      links.map(link => ({
        text: link.textContent?.trim(),
        href: link.href
      })).filter(link => link.text)
    );

    // Take final screenshot
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_final.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_final.png'));

    return {
      success: true,
      action: "Extracted product data, user profile links, categories, and all page links",
      extractedData: {
        products: productData,
        profileLinks,
        categories,
        allLinks: allLinks.slice(0, 50) // Limit to first 50 links
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete bulk data extraction",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
